window.bookSummaryJSON = "<p>Carl thought his life was on track until disaster struck. Now he looks like a 35-year-old and is out of points, so he needs to scramble to change the situation before anyone finds out the truth.&nbsp;</p> <p>The question is, what should he do next? Buy more businesses, or focus on his love life? And always in the background is his family, wondering what happened to their father and grandfather and if he will ever talk to them again.</p> <p><i>Biomedical Self-Engineering: Book 2</i> is a LitRPG slice-of-life adventure, following Carl as he discovers new ways of living when he is nearing the end of his own life. There are no explicit scenes or harems, and very little swearing.</p>"; 
